import React from 'react';
import { useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';
import { 
  Rocket, 
  Zap, 
  Shield, 
  Users, 
  ArrowDown,
  CheckCircle,
  Star
} from 'lucide-react';
import './LandingPage.css';

const LandingPage = () => {
  const navigate = useNavigate();

  const scrollToConfig = () => {
    document.getElementById('config-section').scrollIntoView({ 
      behavior: 'smooth' 
    });
  };

  const startBuilding = () => {
    navigate('/configure');
  };

  const features = [
    { icon: <Zap size={24} />, title: "Lightning Fast", desc: "Build your SaaS in minutes, not months" },
    { icon: <Shield size={24} />, title: "Secure & Reliable", desc: "Enterprise-grade security built-in" },
    { icon: <Users size={24} />, title: "Scalable", desc: "Grows with your business needs" },
    { icon: <CheckCircle size={24} />, title: "No Code Required", desc: "Drag, drop, and launch" }
  ];

  const testimonials = [
    { name: "Sarah Johnson", role: "Freelance Designer", rating: 5, text: "Built my portfolio site in 30 minutes. Absolutely amazing!" },
    { name: "Mike Chen", role: "Digital Coach", rating: 5, text: "The best investment I made for my coaching business." },
    { name: "Emma Davis", role: "E-commerce Owner", rating: 5, text: "From idea to live store in under an hour. Incredible!" }
  ];

  return (
    <div className="landing-page">
      {/* Hero Section */}
      <section className="hero">
        <div className="container">
          <motion.div 
            className="hero-content"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
          >
            <div className="hero-badge">
              <Rocket size={16} />
              <span>Build Your SaaS in Minutes</span>
            </div>

            <h1 className="hero-title">
              Transform Your Ideas Into
              <span className="gradient-text"> Professional SaaS</span>
              <br />In Minutes, Not Months
            </h1>

            <p className="hero-subtitle">
              Stop spending months on development. Our AI-powered platform helps you create 
              professional SaaS applications, websites, and digital products in minutes. 
              No coding required.
            </p>

            <div className="hero-actions">
              <button className="btn btn-primary btn-large" onClick={startBuilding}>
                <Rocket size={20} />
                Build Your SaaS Now
              </button>
              <button className="btn btn-secondary btn-large" onClick={scrollToConfig}>
                <ArrowDown size={20} />
                See How It Works
              </button>
            </div>

            <div className="hero-stats">
              <div className="stat">
                <span className="stat-number">500+</span>
                <span className="stat-label">SaaS Built</span>
              </div>
              <div className="stat">
                <span className="stat-number">30min</span>
                <span className="stat-label">Average Time</span>
              </div>
              <div className="stat">
                <span className="stat-number">99%</span>
                <span className="stat-label">Success Rate</span>
              </div>
            </div>
          </motion.div>
        </div>

        <div className="hero-background">
          <div className="gradient-orb orb-1"></div>
          <div className="gradient-orb orb-2"></div>
          <div className="gradient-orb orb-3"></div>
        </div>
      </section>

      {/* Features Section */}
      <section className="features">
        <div className="container">
          <motion.div 
            className="section-header"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            <h2>Why Choose SaaS Builder?</h2>
            <p>Everything you need to launch your digital business successfully</p>
          </motion.div>

          <div className="features-grid">
            {features.map((feature, index) => (
              <motion.div 
                key={index}
                className="feature-card"
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                viewport={{ once: true }}
              >
                <div className="feature-icon">
                  {feature.icon}
                </div>
                <h3>{feature.title}</h3>
                <p>{feature.desc}</p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Testimonials Section */}
      <section className="testimonials">
        <div className="container">
          <motion.div 
            className="section-header"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            <h2>What Our Customers Say</h2>
            <p>Join thousands of entrepreneurs who've transformed their ideas into reality</p>
          </motion.div>

          <div className="testimonials-grid">
            {testimonials.map((testimonial, index) => (
              <motion.div 
                key={index}
                className="testimonial-card"
                initial={{ opacity: 0, scale: 0.9 }}
                whileInView={{ opacity: 1, scale: 1 }}
                transition={{ duration: 0.6, delay: index * 0.2 }}
                viewport={{ once: true }}
              >
                <div className="testimonial-rating">
                  {[...Array(testimonial.rating)].map((_, i) => (
                    <Star key={i} size={16} fill="#fbbf24" color="#fbbf24" />
                  ))}
                </div>
                <p className="testimonial-text">"{testimonial.text}"</p>
                <div className="testimonial-author">
                  <strong>{testimonial.name}</strong>
                  <span>{testimonial.role}</span>
                </div>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section id="config-section" className="cta-section">
        <div className="container">
          <motion.div 
            className="cta-content"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
          >
            <h2>Ready to Build Your SaaS?</h2>
            <p>Start your journey today and see your idea come to life in minutes</p>
            <button className="btn btn-primary btn-large" onClick={startBuilding}>
              <Rocket size={20} />
              Start Building Now
            </button>
          </motion.div>
        </div>
      </section>
    </div>
  );
};

export default LandingPage;
